import { Box, Text } from '@chakra-ui/react';
import { ButtonRed } from '../../components/ButtonRed';
import { Header } from '../../layout/components/Header';
import MainNavigation from '../../layout/components/MainNavigation';
import classes from './index.module.css';

export function Home() {
    return (
      <Box className={classes.homeBlock}> 
        <Box p={"25px"}>
              <Box className='thisOne' display={"flex"} flexDirection={"column"}> 
                        <Header display={"flex"} flexDirection={"row"} justifyContent={"space-between"} />

                        <Box   display={"flex"} 
                          color={"#DEDCE7"}
                            boxSizing={"border-box"}
                            bg={"#302D3D"}
                            borderRadius={"20px"}
                            fontSize={"110px"}
                            fontFamily={"Inter"}
                            fontWeight={500}>
                            <Text>Становись</Text>
                            <Text><span style={{background:"red"}}>Java</span>-разработчиком</Text>
                            <Text>вместе с нами</Text>
                        </Box>
                        <Box  >
                              <Text>
                                    Получи классную востребованную профессию и зарабатывай дома в удобное время
                              </Text>
                            <ButtonRed text="Начать учиться"/>
                        </Box>

                        <MainNavigation/> 
                   </Box>

        </Box>
      </Box>
    );
  }
